import { Box, Grid, Stack, Typography } from '@mui/material';

function ContractInformationForm() {
  return (
    <Box>
      <Stack
        component="form"
        direction="column"
        spacing={2}
        sx={{
          paddingLeft: '20px',
          paddingRight: '20px',
          gap: '10px',
          display: 'flex',
          maxWidth: '400px',
          width: '100%',
        }}
      >
        <Grid
          item
          xs={4}
          sx={{
            paddingLeft: '0 !important',
            paddingTop: '0 !important',
            display: 'flex',
            alignItems: 'center',
            marginTop: '0 !important',
          }}
        >
          <Typography
            variant="body2"
            gutterBottom
            sx={{
              fontFamily: 'SVN-Sofia-Regular',
              display: 'flex',
              alignItems: 'center',
              margin: 0,
              fontSize: '16px',
            }}
          >
            <Box component="span" sx={{ color: 'rgb(229, 72, 77)', margin: 0 }}></Box>
          </Typography>
        </Grid>
        <Grid item xs={8} sx={{ paddingLeft: '0 !important', paddingTop: '0 !important' }}></Grid>
      </Stack>
    </Box>
  );
}

export default ContractInformationForm;
